import React from 'react';
import '../Result/Result.css'

class Result extends React.Component {

    state = {
        className: 'closed-result',
    }

    openResultHandler = () => {
        this.setState({
            className: 'opened-result'
        })
    }

    closeResultHandler = () => {
        this.setState({
            className: 'closed-result'
        })
    }

    render(){

        return (
            <div className={this.props && this.props.inputValues && this.props.in}>
                {(this.props && this.props.inputValues && this.props.inputValues.valorHora && `O valor da sua hora é: R${this.props.inputValues.valorHora}`) || ''}
            </div>
        );
    }
}




export default Result;
